import Card from "./Card";
import "./Middle-Section.css";

const Middle = () => {
  return (
    <div className="background">
      <div className="card-div">
        <Card top="3" bottom="CLIENTS HELPED">
            <p>3</p>
            <p>CLIENTS HELPED</p>
        </Card>
        <Card top="20k" bottom="TOTAL AD SPEND">
            <p>20k</p>
        </Card>
        <Card top="01" bottom="SERVICES OFFERED"></Card>
      </div>
    </div>
  );
};

export default Middle;
